import React, {Component, Fragment} from 'react';

class myName extends Component {
    render() {
        return (
            <Fragment>
                <h3>안녕하세요. 나는 <b>{this.props.name}</b> 이예요 ~!</h3>
            </Fragment>
        )
    }
}

export default myName;
